package OOPsBasicProject;

public class CalMultiplication extends Calculator {

	@Override
	public int multiplication(int a, int b) {
		// TODO Auto-generated method stub
		return super.multiplication(a, b);
	}

	public int multiplication(int a,int b,int c)
	{
		return a*b*c;
	}
	
	public int multiplication(int a,int b,int c,int d)
	{
		return a*b*c*d;
	}
	
	public int multiplication(int a,int b,int c,int d,int e)
	{
		return a*b*c*d*e;
	}
}
